static inline void decode_residual_inter(AVSContext *h) {

    int block;



    /* get coded block pattern */

    h->cbp = cbp_tab[get_ue_golomb(&h->s.gb)][1];

    /* get quantizer */

    if(h->cbp && !h->qp_fixed)

        h->qp += get_se_golomb(&h->s.gb);

    for(block=0;block<4;block++)

