static void generate_len_table(uint8_t *dst, uint64_t *stats, int size){

    heap_elem_t h[size];

    int up[2*size];

    int len[2*size];

    int offset, i, next;



    for(offset=1; ; offset<<=1){

        for(i=0; i<size; i++){

            h[i].name = i;

            h[i].val = (stats[i] << 8) + offset;

        }

        for(i=size/2-1; i>=0; i--)

            heap_sift(h, i, size);



