    avio_read(pb, st->codec->extradata + 0x5a, atom.size);

    av_log(c->fc, AV_LOG_TRACE, "Reading SMI %"PRId64"  %s\n", atom.size, st->codec->extradata + 0x5a);

    return 0;

}

