    ret = av_frame_ref(dst->f, src->f);

    if (ret < 0)

        return ret;



    av_assert0(!dst->progress);



    if (src->progress &&

        !(dst->progress = av_buffer_ref(src->progress))) {

        ff_thread_release_buffer(dst->owner, dst);

        return AVERROR(ENOMEM);

    }



    return 0;

}

